package org.tsn.loop;

import java.util.Scanner;

public class While {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int num1 = sc.nextInt();
		int i=1 ;
		while(i<=num1)
		{
			System.out.println(i);
			i++;
		}

	}

}
